import { takeEvery, select, put, call } from 'redux-saga/effects';
import { putRequestServer } from '../../store/serverViewType/actions/actionViewType';
import fetchData from '../../functions/fetchData';
import {url_PUT} from "../../constans/url"
import { START_PUT_REQUEST } from '../../store/serverViewType/types';


export function fetchDataPost(url, method, body){
    return fetch( url,{
                
                method: method,
                headers: {
                    Accept: 'application/json',
                    'Content-Type': 'application/json'
                  },
                body: JSON.stringify(body)
                })
                .then(response => response.json())
}

export function* dataSendServer() {
}

export function* workerStart_PUT_RequestServer(){
    
    try {
        const stateSendServer = yield select(state => state.WindowCreateNewData.stateData);

        stateSendServer.uid = Number(stateSendServer.uid);

        console.log('workerStart_PUT data send server 111', stateSendServer)
        
        const data = yield call(fetchData, url_PUT, 'PUT', stateSendServer);
        
        const oldStateTable = yield select(state => state.stateTable);

        yield put(putRequestServer(data, oldStateTable));
         
    } catch (error) {
       console.log('workerStart_PUT_RequestServer error ', error);
    }
 
}

export function* watch_ViewType_PUT_RequestServer(){
    
    yield takeEvery(START_PUT_REQUEST, workerStart_PUT_RequestServer)
}
